Prestação de Serviços Técnicos Especializados, sob responsabilidade de profissional legalmente habilitado, com formação em Engenharia Sanitária, regularmente inscrito no CREA, com atribuições compatíveis com o objeto.
As atividades compreendem:
Recomendações periódicas para manutenção preventiva, com base em diretrizes dos fabricantes e análise técnica não vinculante; Acompanhamento remoto da operação sistêmica, com vistas à geração de relatórios técnicos analíticos, de caráter indicativo, contendo observações gerais sobre o comportamento operacional da captação, ETA e rede de água;
Capacitação básica da equipe local, mediante orientações operacionais para uso adequado dos recursos, com foco na autonomia do contratante;
Análise técnica dos dados coletados por sistemas de supervisão (SCADA, SIG ou equivalentes), com identificação de tendências, variações e sugestões técnicas de caráter orientativo para eventual otimização de processos;
Atendimento remoto ou presencial, exclusivamente mediante solicitação formal do contratante, visando suporte em dúvidas ou validação de decisões operacionais estratégicas;
Os trabalhos terão caráter consultivo e não executivo, não sendo atribuída à contratada qualquer responsabilidade direta ou indireta pela operação do sistema de abastecimento de água;
O serviço a ser prestado visa exclusivamente apoiar a melhoria contínua da gestão pública, mantendo a titularidade e a execução das atividades operacionais sob responsabilidade do ente contratante.
Modelar e simular o comportamento da rede hidráulica com base em dados capturados em campo nos pontos críticos de pressão (PCPs).

O XIV Fórum da Mulher Contabilista do Amazonas, que apresentará o tema: "Mulheres, Superando Barreiras e Inspirando Carreiras", foi formatado foi formatado para o seguinte público alvo: Profissionais da Contabilidade, acadêmicos de contabilidade e demais interessados nos temas tratados na programação.

O objetivo do evento é:

I) Enfocar o papel e o valor da mulher contabilista, da sua importância no mercado de trabalho e a sua participação na luta pela valorização da profissão contábil;

II) Promover o aprimoramento técnico e sócio-cultural;

III) Desenvolver ações de incentivos à maior participação das mulheres contabilistas na vida social, da classe da região e do País;

IV)Promover o empreendedorismo na classe contábil,bem como atualizar e expandir os conhecimentos e competências técnicas e profissionais, as habilidades multidisciplinares e a elevação do comportamento social, moral e ético dos profissionais da contabilidade.
